import './singleTask.css';

function singleTask() {
  return (
    <div className="single-task">
        <div className="task-name">
            This is task 1    
        </div>

        <div className="action">
            <div className="tick">
            <i class="fa-solid fa-check"></i>
            </div>

            <div className="delete">
                
            </div>    
        </div>
    </div>
  );
}

export default singleTask;
